import React from "react";
import {useFormik} from "formik";

const initialValues = {
    userName:"",
    mobile:"",
}
function FomikForm(){
    const formBag  = useFormik({
        initialValues:initialValues,
        onSubmit:(value)=>{
            console.log(value);

        }
    })


    return(
        <form className="flex flex-col items-center p-2 border-2" onSubmit={formBag.handleSubmit }>

            <div  className="flex flex-col items-center p-2 border-2">
            <input className="border-2" type="text" name="userName" placeholder="userName" onChange={formBag.handleChange}/>
            <input className="border-2" type="text" name="mobile" placeholder="mobile" onChange={formBag.handleChange}/>
            <button type="submit">Submit</button>
            </div>
        </form>
    )
}
